import axios from "axios";
import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import ProfileSellingBetCard from "./ProfileSellingBetCard";
import Footer from "../../Helpers/Footer";
import Paginator from "../../Helpers/Paginator";

export default function ProfileSellingBets() {
    const params = useParams();
    const [baseLink, setBaseLink] = useState("");
    const [pagesCount, setPagesCount] = useState(0);
    const [bets, setBets] = useState([]);

    useEffect(() => {
        let product_id = params.action;
        setBaseLink(`http://localhost:3000/profile/selling/${product_id}/bet`);
        if (product_id) {
            axios.get(`/bets/list-product-bets/${product_id}`)
                .then(res => {
                    setPagesCount(res.data.pagesCount);
                    setBets(res.data.betsData.bets);
                });
        }
    }, [params]);

    if (bets) {
        return (
            <div>
                {bets.length 
                    ?
                    <>
                        <div className="flex flex-col justify-center items-center font-medium">
                            <div className="flex flex-wrap items-center mb-4 rounded-lg p-4 bg-slate-800 text-white">
                                <label htmlFor="fromDate" className="mr-2">
                                    Дата ставки от:
                                </label>
                                <input type="date" id="fromDate" placeholder="From Date" className="border text-black rounded-lg p-2 mr-2"/>
                                <label htmlFor="toDate" className="mr-2 ml-4">
                                    Дата ставки до:
                                </label>
                                <input type="date" id="toDate" placeholder="To Date" className="border  text-black rounded-lg p-2 mr-2"/>
                                <label htmlFor="price" className="mr-2 ml-4">
                                    Сумма ставки:
                                </label>
                                <select id="price" className="border rounded-lg p-2 mr-2">
                                    <option value="asc">Сначала высокая</option>
                                    <option value="desc">Сначала низкая</option>
                                </select>
                                <label htmlFor="rating" className="mr-2 ml-4">
                                    Рейтинг покупателей:
                                </label>
                                <select id="rating" className="border rounded-lg p-2 mr-2">
                                    <option value="asc">Сначала высокий</option>
                                    <option value="desc">Сначала низкий</option>
                                </select>
                                <label htmlFor="status" className="mr-2 ml-4">
                                    Статус:
                                </label>
                                <select id="status" className="border rounded-lg p-2 mr-2">
                                    <option value="accepted">Сделана</option>
                                    <option value="declined">Принята</option>
                                    <option value="pending">Отклонена</option>
                                </select>
                            </div>
                        </div>

                        <div className="flex justify-center items-center mt-2 mb-4">
                            <Paginator pagesCount={pagesCount} baseLink={baseLink}/>
                        </div>
                        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4">
                            {bets.map((bet) => (
                                <ProfileSellingBetCard bet={bet}/>
                        ))}
                        </div>
                        <div className="flex justify-center items-center mt-4">
                            <Paginator pagesCount={pagesCount} baseLink={baseLink}/>
                        </div>
                    </> 
                    :
                    <>
                    </>
                }

                {bets.length 
                    ?
                    <div className="mt-24">
                        <Footer />
                    </div>
                    :
                    <div>
                        <h2 className="text-center text-2xl">Ставки не найдены</h2>
                        <br/>
                        <br/>
                        <div className="mt-96">
                            <Footer />
                        </div>    
                    </div>
                }
            </div>
        );
    }
}
